script: |
  super -f text -I q12258.spq | sort > q12258.out

inputs:
  - name: q12258.spq
    data: |
      SELECT DISTINCT + + ( ( - 98 ) ) AS col1, + col2 / col0 * - 32 * + col0 FROM tab2 (FORMAT parquet) WHERE - - col2 BETWEEN - col2 * - - 99 + + CAST ( - col1 AS INTEGER ) * - col1 AND NULL;
  - name: tab2

outputs:
  - name: q12258.out
    data: |
